import { Component, OnInit, Input } from '@angular/core';
import { Observable } from 'rxjs';
import { NgbModal, ModalDismissReasons, NgbActiveModal } from '@ng-bootstrap/ng-bootstrap';
import { FormGroup, FormControl } from '@angular/forms';
import {Router, Params, ActivatedRoute} from "@angular/router";
import {Location} from '@angular/common';
import { DomSanitizer } from '@angular/platform-browser';

//Services
import { FormDataBillingService } from '../../services/form-data-billing.service';
import { AjustesService } from '../../services/ajustes.service';

//PDF
import * as jspdf from 'jspdf';   
import html2canvas from 'html2canvas'; 

@Component({
  selector: 'app-result-information',
  templateUrl: './result-information.component.html',
  styleUrls: ['./result-information.component.css']
})
export class ResultInformationComponent implements OnInit {
  @Input() formData;

  public indexT:number = 0;
  public discount:number = 0;
  public taxes:number = 0;
  public overhead:number = 0;
  public img_asignature_asing:String="";
  public img_logo_nico:String="";
  public img_logo_gray:string="";

  constructor(
    private _location: Location,
    private _route: ActivatedRoute,
    private formDataService: FormDataBillingService,
    private domSanitizer: DomSanitizer,
    private _ajustesService: AjustesService

    )
  {
    this.img_logo_nico = 'data:image/png;base64,'
    this.img_asignature_asing = 'data:image/png;base64,'

    this.img_logo_gray = 'data:image/png;base64,'

    this._ajustesService.getGanancia().subscribe((ganancia:any) => {
      this.overhead = ganancia.percentOverhead/100;      
    });
  }

  ngOnInit() {
    this.formData = this.formDataService.getFormData();
   }   

  goPrevStep(){
    this._location.back();
  }

  captureScreen(){
    var data = document.getElementById('contentToConvert');  
    html2canvas(data).then(canvas => {  
      // Few necessary setting options  
      var imgWidth = 208;   
      var pageHeight = canvas.height;   
      var imgHeight = (pageHeight * imgWidth / canvas.width) + 10;
  
      const contentDataURL = canvas.toDataURL('image/png')  
      let pdf = new jspdf('p', 'mm', 'a4'); // A4 size page of PDF  
      pdf.page = 1;
      // pdf.text(150,285, 'PAola NO me AMAAA'); //print number bottom right
      var position = 10.5;  
      pdf.addImage(contentDataURL, 'PNG', 0, position, imgWidth, imgHeight)  
      pdf.save(`ref:${this.formData.ref}`); // Generated PDF   
    });  
   }  






}

